import React from 'react';
import { FlatList } from 'react-native';

import { offerItems } from '../../images';

function Categories() {
	return (
		<FlatList
			data={offerItems}
			renderItem={({ item }) => (
				<View>
					<Text>item</Text>
				</View>
			)}
			numColumns={2}
		/>
	);
}

export default Categories;
